<h2><span class="mw-headline" id="Overview">Overview</span></h2>
<p>Small and compact, the <b>Yokohama</b> is almost <a href="/index.php/M6" title="M6">corvette</a>-sized. Coupled with its strong shields, this makes it very difficult to destroy. However, it is incapable of mounting any form of anti-capital weapon, making it the frigate with the least offensive potential against larger ships. It is best used in an anti-fighter role or to beat down <a href="/index.php/M6" title="M6">corvettes</a> and other <a href="/index.php/M7" title="M7">frigates</a>.
</p>
<h2><span class="mw-headline" id="Background">Background</span></h2>
<p>The Yokohama <a href="/index.php/M7" title="M7">frigate</a> excels at providing stand-off support and protection to a carrier task force.
</p>
<h2><span class="mw-headline" id="Physical_Characteristics">Physical Characteristics</span></h2>
<p>White colored and compact, the Yokohama appears to be an extension of the <a href="/index.php/Terran" title="Terran">Terran</a> <a href="/index.php/Katana" title="Katana">Katana</a> design, with a nearly identical frame and sloping bow. The exposed main gun mounts of the <a href="/index.php/Katana" title="Katana">Katana</a> are moved to directly below the Yokohama's bridge and small wings extend from each side in their place. The Yokohama's bridge, like the Katana's, offers a completely unobstructed view of space.
</p>
<h2><span class="mw-headline" id="Combat">Combat</span></h2>
<p>In a straight fight versus other capital ships, the Yokohama's advantage in defence is nullified by its weakness in attack. The <a href="/index.php/M6" title="M6">corvette</a>-level <a href="/index.php/Matter/Anti-Matter_Launcher" title="Matter/Anti-Matter Launcher">Matter/Anti-Matter Launcher</a> lacks the punch of the <a href="/index.php/Commonwealth" title="Commonwealth">Commonwealth</a> frigates' <a href="/index.php/Incendiary_Bomb_Launcher" title="Incendiary Bomb Launcher">Incendiary Bomb Launcher</a>, but it does give the Yokohama a unique advantage in its lack of weapon energy drain. As such, the Yokohama has greater endurance than most of its <a href="/index.php/Commonwealth" title="Commonwealth">Commonwealth</a> counterparts and will keep firing for longer than others in large battles against multiple capital opponents.
</p><p>Alternatively, the Yokohama can equip up to twelve <a href="/index.php/Starburst_Shockwave_Cannon" title="Starburst Shockwave Cannon">Starburst Shockwave Cannons</a>, which, combined with its above average shielding, make it extremely effective in an anti-fighter role. With this load-out and a sufficient number of the extraordinarily potent <a href="/index.php/Wraith_Missile" title="Wraith Missile">Wraith Missile</a>, the Yokohama can destroy any opponent. Unfortunately the paltry cargo capacity ensures difficulty in crafting a truly versatile load out, especially when considering M/AML ammo.
</p><p>Yokohamas have issues with their turret coverage; sticking close to the lower right or left hand corners of the ship expose you/enemies to only one turret. If you manage to park a ship directly under it towards the rear and fire, it is a complete blind-spot, leaving the Yokohama helpless as long as you maintain a similar speed to it.
</p>
<h2><span class="mw-headline" id="Equipment">Equipment</span></h2>
<p><b>Hardpoints:</b>
</p>
<ul><li><a href="/index.php/Electro-Magnetic_Plasma_Cannon" title="Electro-Magnetic Plasma Cannon">Electro-Magnetic Plasma Cannon</a></li>
<li><a href="/index.php/Matter/Anti-Matter_Launcher" title="Matter/Anti-Matter Launcher">Matter/Anti-Matter Launcher</a></li>
<li><a href="/index.php/Starburst_Shockwave_Cannon" title="Starburst Shockwave Cannon">Starburst Shockwave Cannon</a></li></ul>
<p><b>Missiles:</b>
</p>
<ul><li><a href="/index.php/Wraith_Missile" title="Wraith Missile">Wraith Missile</a></li>
<li><a href="/index.php/Poltergeist_Missile" title="Poltergeist Missile">Poltergeist Missile</a></li>
<li><a href="/index.php/Spectre_Missile" title="Spectre Missile">Spectre Missile</a></li></ul>
<h2><span class="mw-headline" id="Availability">Availability</span></h2>
<p>The Yokohama is available for purchase from <a href="/index.php/Terran_Shipyard" title="Terran Shipyard">Terran Shipyards</a> in the following sectors:
</p>
<ul><li><a href="/index.php/Mars" title="Mars">Mars</a></li>
<li><a href="/index.php/The_Moon" title="The Moon">The Moon</a></li>
<li><a href="/index.php/Saturn" title="Saturn">Saturn</a></li></ul>
<h2><span class="mw-headline" id="Suggested_Roles">Suggested Roles</span></h2>
<p>The Yokohama is an effective patrol leader in sectors frequented by pirates. Specializing in an anti-fighter role, it can also serve as an effective escort for larger ships.
</p><p>Equipped with twelve SSCs and four EMPCs, the Yokohama also proves quite effective as an <a href="/index.php/OOS" title="OOS" class="mw-redirect">OOS</a> fast response vessel, capable of taking out a <a href="/index.php/Xenon_Q" title="Xenon Q" class="mw-redirect">Xenon Q</a> with fighter escort in approximately 30 seconds. This is provided the player watches the fight, which tends to prevent the Q from "one-shotting" the Yokohama.
</p>
